import "./App.css";
import Login from "./components/pages/log/Login";
import Wallpaper from "./components/pages/log/Wallpaper";
import { socket } from "./config/socket";

function App() {
  return (
    <div className=" flex flex-row">
      <Wallpaper />
      <Login socket={socket} />
    </div>
  );
}

export default App;
